import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import ListItemAvatar from '@material-ui/core/ListItemAvatar';
import Avatar from '@material-ui/core/Avatar';
import Profil from './images/Profil.jpg';
import Typography from '@material-ui/core/Typography';
import Grid from '@material-ui/core/Grid';
import './App.css';

const styles = theme => ({
  root: {
    width: '100%',
    maxWidth: 360,
    backgroundColor: 'transparent',    
  },
  inline: {
    display: 'inline',
  },
});

function SkillsList(props) {
  const { classes } = props;
  return (
    <List className={classes.root}>
    <Grid container spacing={16}>
    <Grid item xs={12} md={6}>
      <ListItem alignItems="flex-start">
        <ListItemAvatar>
          <Avatar alt="Remy Sharp" src={Profil} />
        </ListItemAvatar>
        <ListItemText><p className='TexteSkills'>HTML5</p></ListItemText>
          </ListItem>
          <ListItem alignItems="flex-start">
        <ListItemAvatar>
          <Avatar alt="Remy Sharp" src={Profil} />
        </ListItemAvatar>
        <ListItemText><p className='TexteSkills'>CSS3</p></ListItemText>
          </ListItem>
          <ListItem alignItems="flex-start">
        <ListItemAvatar>
          <Avatar alt="Remy Sharp" src={Profil} />
        </ListItemAvatar>
        <ListItemText><p className='TexteSkills'>Javascript/React</p></ListItemText>
          </ListItem>
          <ListItem alignItems="flex-start">
        <ListItemAvatar>
          <Avatar alt="Remy Sharp" src={Profil} />
        </ListItemAvatar>
        <ListItemText><p className='TexteSkills'>Redux</p></ListItemText>
          </ListItem>
          </Grid>
          <Grid item xs={12} md={6}>
          <ListItem alignItems="flex-start">
        <ListItemAvatar>
          <Avatar alt="Remy Sharp" src={Profil} />
        </ListItemAvatar>
        <ListItemText><p className='TexteSkills'>Node.js</p></ListItemText>
          </ListItem>
          <ListItem alignItems="flex-start">
        <ListItemAvatar>
          <Avatar alt="Remy Sharp" src={Profil} />
        </ListItemAvatar>
        <ListItemText><p className='TexteSkills'>MySQL</p></ListItemText>
          </ListItem>
          <ListItem alignItems="flex-start">
        <ListItemAvatar>
          <Avatar alt="Remy Sharp" src={Profil} />
        </ListItemAvatar>
        <ListItemText><p className='TexteSkills'>Git</p></ListItemText>
          </ListItem>
          <ListItem alignItems="flex-start">
        <ListItemAvatar>
          <Avatar alt="Remy Sharp" src={Profil} />
        </ListItemAvatar>
        <ListItemText><p className='TexteSkills'>Scrum</p></ListItemText>
          </ListItem>
          </Grid>         
          </Grid>
         </List>  

 );
}

SkillsList.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(SkillsList);

